import Vue from 'vue'
import App from './App.vue'
import '@/assets/css/style.css'; 
import '@/assets/js/script'; 
import { IonicVue } from '@ionic/vue';

const app = createApp(App)
  .use(IonicVue);
Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')
